import React from 'react';

function Navigation() {
  return (
    <nav className="Navigation">
      <h3>Ready Roofer</h3>
      <ul className>
          <li>Get A Quote</li>
          <li>About</li>
      </ul>
    </nav>
  );
}

export default Navigation;
